    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);

        getWindow().setFlags(WindowManager.LayoutParams.FLAG_FULLSCREEN,WindowManager.LayoutParams.FLAG_FULLSCREEN);

        setContentView(R.layout.activity_main);

        ImageButton btnMenu = findViewById(R.id.btnMenu);

        FragmentManager fm = getSupportFragmentManager();
        fm.beginTransaction()
                .replace(R.id.fragmentFrame, MenuFragment.class, null)
                .setReorderingAllowed(true)
                .addToBackStack("name")
                .commit();
        btnMenu.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View view) {
                FragmentManager fm = getSupportFragmentManager();
                fm.beginTransaction()
                        .replace(R.id.fragmentFrame, MenuFragment.class, null)
                        .setReorderingAllowed(true)
                        .addToBackStack("name")
                        .commit();
                setHeadline("Menu");
            }
        });
    }

    MediaPlayer player;

    public void play(int x) {
        if (player == null) {
            player = MediaPlayer.create(this, x);
            player.setOnCompletionListener(new MediaPlayer.OnCompletionListener() {
                @Override
                public void onCompletion(MediaPlayer mediaPlayer) {
                    stopPlayer();
                }
            });
        }
        player.start();
    }

    public void pause(){
        if(player!=null){
            player.pause();
        }
    }

    public void stopPlayer(){
        if (player!=null) {
            player.release();
            player=null;
            Toast.makeText(this, "Media telah dimainkan", Toast.LENGTH_SHORT).show();
        }
    }

    public void setHeadline(String txt){
        TextView editHeadline = findViewById(R.id.headline);
        editHeadline.setText(txt);
    }

    public boolean checkHeadline(String txt){
        TextView checkHeadline = findViewById(headline);
        boolean hasil = checkHeadline.equals(txt);
        return hasil;
    }

    @Override
    protected void onStop() {
        super.onStop();
        stopPlayer();
    }

