    public int checkbm(Integer x, Integer y, Integer z){
        int a=0;
        for (int i=0; i<bmcounter;i++){
            if(bookmark[i][0] == x && bookmark[i][1] == y && bookmark[i][2] == z){
                a=1;
                break;
            }
        }
        return a;
    }
    public void setBm(Integer x, Integer y, Integer z){
        bookmark[bmcounter][0]=x;
        bookmark[bmcounter][1]=y;
        bookmark[bmcounter][2]=z;
        bmcounter++;
    }

    public void remBm(Integer x, Integer y, Integer z){
        for (int i=0; i<bmcounter;i++){
            if(bookmark[i][0] == x && bookmark[i][1] == y && bookmark[i][2] == z){
                for(int j=i+1; j<bmcounter; j++){
                    bookmark[j-1][0] = bookmark[j][0];
                    bookmark[j-1][1] = bookmark[j][1];
                    bookmark[j-1][2] = bookmark[j][2];
                }
                bmcounter--;
            }
        }
    }
